import NavBar from "./src/navigation/AppNavigation";
import Login from "./src/screens/Account/LoginScreen";

export default function App() {
  return (
    <NavigationContainer>
    <GluestackUIProvider config={config}>
      <Login></Login>
    </GluestackUIProvider>
  </NavigationContainer>
  );
}
